(3, 1, 'MSI', 'Pro DP180 13th Gen', 'Intel Core i5-13400 (20M Cache, up to 4.60 GHz)', 'Intel 610', '8GB 3200MHz DDR4 U-DIMMs', 'Intel UHD Graphics 730', '512GB M.2 PCIe SSD', '500W ATX', 'Intel Wi-Fi AC3168 / Intel Wi-Fi AC9462 / Wi-Fi 6E AX211 BLUETOOTH: 4.2 (for AC3168) / 5.1 (for AC94', 'Windows 11 Pro', 'N/A', 'N/A', 'N/A', 'N/A', 'I/O (REAR) 1x USB 3.2 Gen 1 Type A 4x USB 2.0 Type A 2x RJ45 LAN (2.5G & 1G) 1x HDMI out (supports ', '168 x 323 x 369 mm (6.61 x 12.72 x 14.53 inch)', '7.59 kg (16.74 lbs) / 9.03 kg (19.91 )', 'Black', '02-years of limited warranty', '73,000', '68,000', '', 'The MSI PRO DP180 13th Gen Core i5 Desktop PC delivers unrivaled performance, expertly engineered to suit the needs of modern computing. At its heart is the powerful Intel Core i5-13400 CPU, which has an amazing 20M cache and a clock speed that can be turbo boosted up to 4.60 GHz. Whether you\'re doing resource-intensive chores, gaming, or creating content, this powerhouse provides a smooth and responsive computing experience. The CPU is complemented by 8GB of high-speed 3200MHz DDR4 U-DIMM RAM, which allows for maximum multitasking and smooth and efficient performance. A 512GB M.2 PCIe SSD takes storage to the next level, providing lightning-fast data access rates and enough of capacity for your apps, files, and multimedia material. The SSD not only speeds up system startup times, but also improves general system responsiveness, resulting in a fast and efficient user experience. Intel UHD Graphics 730 enhances the system\'s visual capabilities by offering dependable graphics performance for a wide range of workloads, including casual gaming and multimedia content consumption. The MSI PRO DP180 desktop PC is built for both productivity and elegance, with a sleek and modern appearance that complements any workstation. Whether you\'re a professional in need of a dependable workstation or a gamer searching for a system capable of handling the most recent titles, the MSI PRO DP180 exemplifies desktop computing innovation and performance. Upgrade your computing experience with the MSI PRO DP180, which combines power and accuracy.'),
(4, 1, 'Dell', 'OptiPlex 3000', 'Intel Core i5-12500 (18M Cache, 3.00 GHz to 4.60 GHz)', 'Intel B660 Chipset', '8GB DDR4 RAM', 'Intel UHD Graphics', '1TB HDD', '180 W', 'Ethernet RJ-45', 'Free-Dos', 'N/A', 'USB Keyboard', 'USB Mouse', 'Yes', 'Front: Two USB 2.0 ports Two USB 3.2 Gen 1 ports Rear: Two USB 2.0 ports with Smart Power On Two USB', '3 years warranty', 'N/A', 'Black', '3 years warranty', '74,250', '67,500', '', 'The Dell OptiPlex 3000 Tower Brand PC features Processor: Intel Core i5-12500 (18M Cache, 3.00 GHz to 4.60 GHz) with innovative Hybrid Core technology, which provides improved performance to power more effective workdays. With 8GB RAM and 1TB HDD, you can multitask and do even more. To reduce the environmental effect, it contains up to 60% post-consumer recycled materials. Its internal chassis and bezel design allow for greater airflow, resulting in optimal cooling efficiency. Two USB 2.0 ports, two USB 3.2 Gen 1 ports, two USB 2.0 ports with Smart Power On, two USB 3.2 Gen 1 ports, one DisplayPort 1.4 port, one HDMI 1.4b connection, one RJ45 Ethernet port, and one Universal audio jack are available on the front. It includes an 18.5\" LED display as well as a mouse and keyboard. It also comes with Intel UHD Graphics and Intel B660. It operates on a free DOS operating system and features a 180-watt power supply.');
INSERT INTO `brand_pc` (`brand_pc_No`, `Hide`, `brand`, `model`, `processor`, `motherboard`, `ram`, `graphics_card`, `_storage_`, `power_supply`, `network_and_wareless_connectivity`, `operating_system`, `security_management`, `keyboard`, `mouse`, `optical_drive`, `extarnal_io_port`, `dimension`, `weight`, `color`, `warranty`, `cut_price`, `final_price`, `product_image_path`, `description`) VALUES
(5, 1, 'Asus', 'ExpertCenter D700MD', 'Intel 12th Gen Core i5-12400 (2.5 GHz to 4.0 GHz, 18 MB)', 'Intel B660 Chipset', '8GB DDR4 3200MHz U-DIMM', 'Intel UHD Graphics 730', '1TB SATA 7200RPM 3.5\" HDD', '300W power supply (80+ Platinum Grade, Peak 390W)', 'Ethernet RJ-45', 'Free DOS', 'US MIL-STD 810H military-grade standard Certified', 'Asus USB Keyboard', 'Asus USB Optical Mouse', 'N/A', 'Front I/O Ports 1x Headphone 1x 3.5mm combo audio jack 2x USB 2.0 Type-A 2x USB 3.2 Gen 1 Type-A 2x ', '16.20 x 29.13 x 35.50 cm (6.38\" x 11.47\" x 13.98\")', '05.00 kg (11.02 lbs)', 'Black', '03-Year Warranty', '73,240', '67,000', '', 'The ASUS ExpertCenter D700MD Desktop PC features an Intel 12th Gen Core i5-12400 CPU with speeds ranging from 2.5 GHz to 4.0 GHz and an amazing 18 MB cache, providing unrivaled performance for your work. With 8GB of high-speed DDR4 3200MHz RAM, you may multitask with ease, providing fast transitions between apps and effective handling of data-intensive activities. The large 1TB SATA 7200RPM HDD provides enough of storage for your papers, files, and entertainment, helping to keep your workspace organized and clutter-free. This PC comes with an Acer USB keyboard and mouse, which improves your entire user experience. This system adapts to your demands whether you\'re plunging into work, content production, or enjoyment. Upgrade your workstation with the ASUS ExpertCenter D700MD Core i5 12th Gen Desktop PC, which provides top-tier processing power, ample memory, and ample storage - all geared to help you with your everyday computing activities.');
INSERT INTO `brand_pc` (`brand_pc_No`, `Hide`, `brand`, `model`, `processor`, `motherboard`, `ram`, `graphics_card`, `_storage_`, `power_supply`, `network_and_wareless_connectivity`, `operating_system`, `security_management`, `keyboard`, `mouse`, `optical_drive`, `extarnal_io_port`, `dimension`, `weight`, `color`, `warranty`, `cut_price`, `final_price`, `product_image_path`, `description`) VALUES
(6, 0, 'HP', '280 Pro G9', 'Intel 12th Gen Core i5-12400 processor (2.5 GHz to 4.4 GHz, 18 MB)', 'Intel H670 Chipset', '8GB DDR4 RAM', 'Intel UHD 770 Graphics', '512GB SSD', '180W', '1 x RJ-45 Intel 802.11a/b/g/n/ac (2x2) Wi-Fi and Bluetooth 4.2', 'FreeDos', 'TPM: Trusted Platform Module 2.0hardware protection and storage for encryption Kensington Lock Slot', 'HP USB Keyboard', 'HP USB Mouse', 'DVD-RW Drive', '2 x USB 2.0, 4 x USB 3.0 Type-A 2 x USB 3.0 Type-C 1x HDMI Port 1x VGA/D-Sub  Expansion Slots 1 x fu', '55 x 305 x 337mm', '10.4 lb; 4.7 kg', 'Black', '3 years', '72,150', '67,000', '', 'The HP Pro Tower 280 G9 is a dependable and efficient desktop PC system designed primarily for professional and commercial applications. It is powered by the Intel Core i3-12100 CPU, which has a spacious 12MB cache and a dynamic clock speed that ranges from 3.30 GHz to an astonishing 4.30 GHz with Intel Turbo Boost technology. This guarantees that the desktop is well-equipped to handle demanding activities, resulting in smooth performance for a variety of apps. The HP Pro Tower 280 G9 has 4GB of DDR4. While this may be deemed basic, it is enough for day-to-day office operations and provides a responsive computing experience. The storage solution is a 256GB SSD, which not only provides enough capacity for important files but also helps to speed up data access, boot times, and general system responsiveness. An HP USB Keyboard and Mouse are included for user convenience, offering a dependable and familiar input method for everyday computer tasks. This considerate inclusion improves the desktop\'s overall usability, putting it ready for instant usage after setup. Whether you\'re working on office productivity, data processing, or general computing, the HP Pro Tower 280 G9 is intended to provide a combination of power and functionality. Its sturdy features, efficient storage, and smart accessories make it an excellent choice for professionals looking for a reliable desktop solution in the workplace.');
INSERT INTO `brand_pc` (`brand_pc_No`, `Hide`, `brand`, `model`, `processor`, `motherboard`, `ram`, `graphics_card`, `_storage_`, `power_supply`, `network_and_wareless_connectivity`, `operating_system`, `security_management`, `keyboard`, `mouse`, `optical_drive`, `extarnal_io_port`, `dimension`, `weight`, `color`, `warranty`, `cut_price`, `final_price`, `product_image_path`, `description`) VALUES
(7, 0, 'Acer', 'Veriton S2680G', '11TH GEN. INTEL CORE 15-11400 2.60GHz TO 4.40GHZ (12MB)', 'N/A', '8GB DDR4 RAM', 'N/A', '1TB HDD', '250W PSU', 'Gigabit Ethernet LAN', 'FREE DOS', 'TPM: Trusted Platform Module 2.0hardware protection and storage for encryption Kensington Lock Slot', 'Yes', 'Yes', 'DVD-RW', 'Slots: 1x PCIe x16 slot 1x PCIe x1 slot 1 x M. 2 slots for SSD Ports: Front: 2 USB2.0, 2 USB 3.2 G 1', '390 (H) x 170 (W) x 370 (D) mm', 'N/A', 'Black', '03-Year Warranty', '68,200', '65,500', '', 'The Acer Veriton S2680G Brand PC is powered by an 11TH GEN. INTEL CORE 15-11400 2.60GHz TO 4.40GHz processor (12MB). It comes with 8GB of DDR4 RAM. This computer features an ACER V206HQL 19.5-inch monitor and Intel UHD Graphics 730. It has a 1TB hard drive for storage. It has Gigabit Ethernet LAN networking. TPM v2.0 FW Kensington lock slot security on the Acer Veriton S2680G Brand PC. This Brand PC has 1 PCIe x16 slot, 1 PCIe x1 slot, and 1 M. There are two SSD slots. It includes two USB 2.0 ports on the front and two USB 3.2 G 1 1 combo ports on the back. 4 USB Rear Jack 2.0, 3 USB ports 1 VGA, 1 HDMI, 3.2 G1 1 Line-in, 1 Line-out, 1 Microphone Port It features a 250W power supply. It came with a built-in high-definition audio controller. this brand of computer\'s FREE DOS operating system features a DVD-RW drive. A USB keyboard and mouse are included with the Acer Veriton S2680G Brand PC. It comes with a 03-year warranty.');
INSERT INTO `brand_pc` (`brand_pc_No`, `Hide`, `brand`, `model`, `processor`, `motherboard`, `ram`, `graphics_card`, `_storage_`, `power_supply`, `network_and_wareless_connectivity`, `operating_system`, `security_management`, `keyboard`, `mouse`, `optical_drive`, `extarnal_io_port`, `dimension`, `weight`, `color`, `warranty`, `cut_price`, `final_price`, `product_image_path`, `description`) VALUES
(8, 0, 'Lenovo', 'ThinkCentre neo 50t', 'Intel Core i5-12500 (18M Cache, 3.00 GHz to 4.60 GHz)', 'N/A', '8 GB DDR4-3200MHz', 'Intel UHD Graphics 770', '1TB 7200rpm HDD 3.5\" SATA', '180W Adapter', 'RealTek Wireless RTL8822CE 2x2 AC & Bluetooth 5.0', 'FreeDos', 'Security Management: Discrete TPM 2.0, TCG certified', 'N/A', 'N/A', 'Slim DVD Writer 9.0mm', 'Front Ports: 2x USB 3.2 Gen 1 2x USB 3.2 Gen 2 1x USB-C 3.2 Gen 1 (support data transfer and 5V@3A c', 'N/A', 'N/A', 'Black', '03 years warranty', '67,650', '61,500', '', 'The Lenovo ThinkCentre Neo 50t Business PC has an Intel 12th Gen Intel Core i5-12500 (18M Cache, 3.00 GHz to 4.60 GHz). The features of this tower workstation include Intel UHD Graphics 770, 1x HDMI 1.4b, 1x DisplayPort 1.4, Chipset Intel B660, 8GB UDIMM DDR4-3200MHz, 2 DDR4 UDIMM slots, and 1TB 7200rpm HDD 3.5\" SATA. The USB Calliope Mouse and Black - English (US) Calliope are included with this Tower Workstation. One PCIe 4.0 x16, full-height, half-length is present here. Two full-height, half-length PCIe 3.0 x1 cards. M.2 slots in two (one for WLAN, one for SSD). Additionally, this workstation features RealTek Wireless RTL8822CE, Intel I219-LM, and 1x GbE RJ-45. 1 USB-C 3.2 Gen 1 (supports data transmission and 5V@3A charging), 1 headphone/microphone combo jack (3.5mm), 2x2 AC, and Bluetooth 5.0 (3.5mm).\r\n\r\nIncreases Productivity and Is Secure by Design\r\nThe Lenovo ThinkCentre Neo 50t Gen 3 Tower has High performance and minimal carbon footprint, thanks to 12th Gen Intel Core CPUs. Regardless of whether you\'re processing huge datasets or simply working on graphics-intensive tasks, these CPUs offer the computing power you require. Innovative ThinkShield security solutions, a group of hardware and software that work together to defend your device and your data, are used to protect the ThinkCentre Neo 50t tower. You may choose from a variety of physical security options, a self-healing BIOS with BIOS Guard and Boot Guard, a discrete Trusted Platform Module (dTPM) 2.0 that encrypts your credentials, and smart USB protection.');
INSERT INTO `brand_pc` (`brand_pc_No`, `Hide`, `brand`, `model`, `processor`, `motherboard`, `ram`, `graphics_card`, `_storage_`, `power_supply`, `network_and_wareless_connectivity`, `operating_system`, `security_management`, `keyboard`, `mouse`, `optical_drive`, `extarnal_io_port`, `dimension`, `weight`, `color`, `warranty`, `cut_price`, `final_price`, `product_image_path`, `description`) VALUES
(9, 0, 'Lenovo', 'IdeaCentre 3 07IAB7', 'Intel Core i5-12400, 6C (6P + 0E) / 12T, P-core 2.5 / 4.4GHz, 18MB', 'Intel B660', '4GB UDIMM DDR4-3200', 'Integrated Intel UHD Graphics 730', '1TB HDD 7200rpm 3.5\"', '260W 85%', 'Ethernet: Integrated 100/1000M WLAN + Bluetooth: 11ac, 2x2 + BT5.0', 'Free DOS', 'N/A', 'USB Calliope Keyboard, Black, English', 'USB Calliope Mouse, Black', 'Yes', 'Front Ports: 2x USB 3.2 Gen 1 1x USB-C 3.2 Gen 1 (support data transfer and 5V@3A charging) 1x headp', '100 x 303.5 x 274.8 mm (3.9 x 11.94 x 10.8 inches)', '6.25 kg (13.8 lbs)', 'Cloud grey', '03-Year', '62,390', '58,000', '', 'The Lenovo IdeaCentre 3 07IAB7 is a powerful desktop PC that offers dependable performance for both work and pleasure. This PC is powered by the Intel Core i5-12400 CPU, which has an amazing 18M cache and a maximum clock speed of 4.40 GHz. The 12th generation Core i5 processor provides efficient multitasking, fluid processing, and a seamless user experience. With 4GB of RAM, the machine can run many apps concurrently, improving overall responsiveness and productivity. The addition of a large 1TB HDD (Hard Disk Drive) gives adequate storage capacity for your documents, multimedia, and programs, ensuring that you have enough area for your digital demands. The integrated Intel UHD 730 graphics provide a visually engaging experience while streaming films, editing images, or playing casual games. While it may not be ideal for high-end gaming, the graphics solution performs well for everyday work. The Lenovo IdeaCentre 3 07IAB7 includes a USB Calliope Keyboard and Mouse, ensuring simplicity and functionality straight out of the box. The peripherals are intended to complement the desktop by offering a comfortable and efficient input experience. The Lenovo IdeaCentre 3 07IAB7 is a well-balanced brand PC ideal for those looking for a dependable and adaptable working solution. The combination of a strong Intel Core i5 CPU, enough RAM, ample storage, and integrated graphics makes it an excellent choice for a wide range of applications, from productivity to entertainment.');

