(3, 1, 'ARKTEK', 'GeForce GT 740', 'GDDR5', '2GB or 2048 MB', 'Digital max resolution: 4096 X 2160 (Through HDMI ', '993 MHz', 'N/A', '5000 MHz', '128 bit', 'N/A', 'Process Technology: 28 nm', 'D-Sub x 1', 'HDMI x 1', 'Dual-link DVI-D x 1', '400W', '64 W', '3', '12', '(H) 23 x (L)164 x (W)111 mm', 'N/A', '02 years warranty', '10,740', '9,500', '', 'Arktek GeForce GT 740 is a 2GB capacity GDDR5 128-bit HDMI,DVI and VGA Graphics Card. The GT 740 gives you 4X faster gaming performance than integrated graphics while delivering rock-solid reliability and stability. NVIDIA GeForce GT740 GPU comes with various supported features. Namely: HDMI with 1080p output, NVIDIA PureVideo HD Technology, NVIDIA PhysX, and CUDA Technology, NVIDIA Surround, NVIDIA FXAA, NVIDIA TXAA Technology, NVIDIA 3D Vision ready, etc. This Graphics card is OS Certified for Windows 7, Windows 8, Windows Vista, and XP. This graphics card is PCI-E 3.0 supported. It has NVIDIA GPU Boost which helps extract every ounce of computing power from graphics cards, maximizing frame rates in each and every game. it has NVIDIA SLI which supports multi-GPU technology for up to 4 GPUs. The NVIDIA Adaptive V-Sync support is a smarter way to render frames using NVIDIA Control Panel software. This card is NVIDIA PhysX ready which creates incredible effects and scenes filled with dynamic destruction, particle-based fluids, and life-like animation. The NVIDIA 3D Vision delivers stereoscopic 3D images for gamers, movie-lovers, and photo enthusiasts. The NVIDIA CUDA enables dramatic increases in computing performance by harnessing the power of the Graphics Processing Unit (GPU). Integrated NVIDIA PureVideo HD Technology delivers stunning picture clarity, smooth video, accurate color, and precise image scaling for movies and video. It has 384SP Stream Processors with an Engine Clock of 993MHz and a 5000MHz Memory Clock with a 128-Bit GDDR5 video Memory Bus. Arktek GeForce GT 740 2GB GDDR5 Graphics Card offers a 2-year Warranty.');
