(4, 1, 'Sapphire', 'Pulse AMD Radeon RX 6600', 'GDDR6', '8GB', '76804320', 'Boost Clock: Up to 2491 MHz', 'Game Clock: Up to 2044 MHz', '14 Gbps Effective', '128 bit', 'PCI-Express 4.0', '1792', '3x DisplayPort (76804320)', '1x HDMI (76804320)', '1 x 8-pin Power Connector', '500 Watt', '140W (Board Power)', 'Maximum 4 Displays', '12 Ultimate', '193(L)X 120.05(W)X 40.05(H)mm', '2 slot, ATX', '02-years warranty', '31,300', '28,500', '', 'The Sapphire Pulse AMD Radeon RX 6600 8GB GDDR6 Graphics Card runs on the powerful Dual-X Cooling Technology coupled with Intelligent Fan Control to keep temperatures low and fan noise low. The refined PCB design delivers stable, reliable, and steady performance, which efficiently lowers PCB temperature and component signal noise. It comes with an 8GB GDDR6 Memory Size. It features a Boost Clock of up to 2491MHz. Sapphire Pulse AMD Radeon RX 6600 features the breakthrough AMD RDNA 2 architecture. It has been engineered to deliver an incredible 1080p experience. The Sapphire Pulse AMD Radeon RX 6600 8GB GDDR6 Graphics Card has 1x HDMI and 3x DisplayPort. It supports up to 76804320 resolution and a maximum of 4 displays can be used. This graphics card has some special features with it. Premium Digital Power Design such as Fuse Protection, Dual-X Cooling Technology, Intelligent Fan Control, Precision Fan Control, Metal Backplate, Two-Ball Bearing Fans, TriXX Supported, and TriXX Boost. It is a very good choice for gamers. It has 2 years of warranty.');
INSERT INTO `graphics_card` (`gp_card_No`, `Hide`, `brand`, `model`, `type`, `size`, `resolution`, `boost_clock`, `game_clock`, `memory_clock`, `bus_type`, `memory_interface`, `stream_processors`, `display_port`, `hdmi`, `connectors`, `recommended_psu`, `consumption`, `multi_display`, `directX`, `dimensions`, `others`, `warranty`, `cut_price`, `final_price`, `product_image_path`, `description`) VALUES
(5, 1, 'GIGABYTE', 'GeForce RTX 3060 GAMING OC', 'GDDR6', '12GB', '7680x4320', '1837 MHz (Reference Card: 1777 MHz)', 'N/A', '15000 MHz', 'Memory Bus: 192 bit', 'N/A', '3584', 'DisplayPort 1.4a x 2', 'HDMI 2.1 x 2', '8 pin x 1', '550W', 'N/A', 'N/A', '12 Ultimate', 'N/A', 'N/A', '03 years warranty', '52,800', '43,900', '', 'GIGABYTE GeForce RTX 3060 GAMING OC Graphics Card featured with 1837 MHz (Reference Card: 1777 MHz), NVIDIA Ampere Streaming Multiprocessors, 2nd Generation RT Cores, 3rd Generation Tensor Cores, Powered by GeForce RTX 3060, Integrated with 12GB GDDR6 192-bit memory interface, WINDFORCE 3X Cooling System with alternate spinning fans, RGB Fusion 2.0 and Protection metal back plate. The RTX 3060 graphics card uses the better power phase design, that allows the MOSFET to operate at lower temperature, and over-temperature protection design and load balancing for each MOSFET, plus the Ultra Durable certified chokes and capacitors, to provide excellent performance and longer system life. And also here, Fully automated production process ensures top quality of the circuit boards and eliminates sharp protrusions of the solder connectors seen on the conventional PCB surface. This friendly design prevents your hands from getting cut or inadvertently damaging components when making your build.'),
(6, 0, 'Asus', 'ASUS Dual Radeon RX 6600', 'GDDR6', '8GB', '7680x4320', 'up to 2491 MHz (Boost Clock)/up to 2064 MHz (Game ', 'up to 2491 MHz (Boost Clock)/up to 2044 MHz (Game ', '14 Gbps', 'PCI Express 4.0', '128-bit', '1792', 'Yes x 3 (Native DisplayPort 1.4a)', 'Yes x 1 (Native HDMI 2.1)', '1 x 8-pin', '500W', 'N/A', '4', 'N/A', '243 x 134 x 49 mm 9.6 x 5.3 x 1.9 inches', 'Slot: 2.5 Slot', '3 Years', '52,840', '48,800', '', 'The ASUS Dual Radeon RX 6600 melds performance and simplicity like no other. It comes with an Axial-tech fan design that features a smaller fan hub that facilitates longer blades and a barrier ring that increases downward air pressure. It features Auto-Extreme Technology and a protective backplate to ensure all-around reliability. It\'s the perfect combination for a powerful plug-and-play experience. Newly designed for the latest generation of top-end ROG graphics cards, these fans feature a smaller hub that facilitates longer blades and a barrier ring to increase downward air pressure. An advanced onboard controller brings fans to a standstill when the GPU core temperature is below 60 Celsius, letting you enjoy light gaming in relative silence. As temps rise past the threshold, the fans automatically start up again. Dust is enemy number one for fans. It\'s easy to clean the blades, but taking the fan apart to remove dust that has made its way inside is not a simple task. The PCB is reinforced by an aluminum backplate that adds structural rigidity, helping to prevent flex and protect components and trace pathways from damage. Each card must meet rigorous performance and reliability standards before it ships. Performance and stress tests are run with the latest chart-topping titles like Fortnite, League of Legends, Overwatch, and PlayerUnknown\'s Battlegrounds. We also carry out reliability trials that include a 144-hour stability test and a series of 3DMark benchmarking runs to ensure the card performs well when pushed to the limits. Experience stutter-free, tear-free gaming with AMD Radeon FreeSync Premium Pro technology, available on many ASUS monitors. The shroud features a subtle illuminated strip that creates a stylish accent for your build. The ASUS GPU Tweak II utility takes graphics card tuning to the next level. It allows you to tweak critical parameters including GPU core clocks, memory frequency, and voltage settings, with the option to monitor everything in');
INSERT INTO `graphics_card` (`gp_card_No`, `Hide`, `brand`, `model`, `type`, `size`, `resolution`, `boost_clock`, `game_clock`, `memory_clock`, `bus_type`, `memory_interface`, `stream_processors`, `display_port`, `hdmi`, `connectors`, `recommended_psu`, `consumption`, `multi_display`, `directX`, `dimensions`, `others`, `warranty`, `cut_price`, `final_price`, `product_image_path`, `description`) VALUES
(7, 0, 'PELADN', 'RX 580 8G', 'GDDR5', '8GB', '7680x4320', '1244MHz', 'N/A', '7000MHz', '256bit', 'PCI Express 3.0', '2048', '3x DP', '1x HDMI', '6Pin', '500W', '150W', '4', 'N/A', '22611444mm', 'N/A', '2 Years Manufacturer Warranty', '14,190', '11,999', '', 'The PELADN RX 580 8G Gaming Graphics Card has 2048 CUDA cores and an Ellesmere graphics processor, providing impressive graphics processing power. It has enough memory for fluid and immersive gaming with 8GB of GDDR5 graphics RAM. The RX 580 has a 1244MHz core frequency and a 7000MHz memory clock speed. The graphics card uses a 256-bit memory bus width to ensure quick and effective data transfer. It balances performance and energy efficiency with a power consumption of 150W. Three DisplayPort ports and an HDMI port are available on the PELADN RX 580, giving users flexibility when connecting to various displays. It needs a 6-pin power interface and is recommended to use a 500W power supply.');
INSERT INTO `graphics_card` (`gp_card_No`, `Hide`, `brand`, `model`, `type`, `size`, `resolution`, `boost_clock`, `game_clock`, `memory_clock`, `bus_type`, `memory_interface`, `stream_processors`, `display_port`, `hdmi`, `connectors`, `recommended_psu`, `consumption`, `multi_display`, `directX`, `dimensions`, `others`, `warranty`, `cut_price`, `final_price`, `product_image_path`, `description`) VALUES
(8, 0, 'NVIDIA', ' Quadro P1000', 'GDDR5', '4 GB', '4x 40962160 @ 60Hz', 'N/A', 'N/A', 'Up to 82 GB/s', 'PCI Express 3.0 x16', '128-bit', '640', '4x mDP 1.4', 'HDCP 2.2', 'N/A', 'N/A', '47 W', '4 direct, 4 DP 1.4', '12.0', '2.713 (H) x 5.7 (L)', 'Thermal Solution: Active Single Slot, Low Profile ', '1 year', '16,500', '15,000', '', 'The NVIDIA Quadro P1000 4GB GDDR5 Graphics Card combines a 640 CUDA core Pascal GPU, 4 GB GDDR5 on-board memory, and advanced display technologies in a low-profile form factor that delivers amazing graphics performance for demanding professional applications. The NVIDIA Quadro P1000 supports four 4K displays (4096x2160 @ 60Hz) with HDR color giving you an expansive visual workspace to see your ideas come to life in stunning detail. Using supported APIs and CUDA, that computing performance can translate into high resolution and realistic real-time 2D and 3D graphics rendering or improved computing speed with hardware acceleration. The NVIDIA Quadro P1000 is certified with a broad range of sophisticated professional applications, tested by leading workstation manufacturers, and backed by a global team of support specialists. This gives you the peace of mind to focus on doing your best work. Whether youre developing revolutionary products or telling spectacularly vivid visual stories, Quadro gives you the performance to do it brilliantly. The NVIDIA Quadro P1000 4GB GDDR5 Graphics Card comes with a 1-year warranty.');
INSERT INTO `graphics_card` (`gp_card_No`, `Hide`, `brand`, `model`, `type`, `size`, `resolution`, `boost_clock`, `game_clock`, `memory_clock`, `bus_type`, `memory_interface`, `stream_processors`, `display_port`, `hdmi`, `connectors`, `recommended_psu`, `consumption`, `multi_display`, `directX`, `dimensions`, `others`, `warranty`, `cut_price`, `final_price`, `product_image_path`, `description`) VALUES
(9, 0, 'Colorful', 'iGame GeForce RTX 4060 Ti Ultra W DUO OC 8GB-V', 'GDDR6', '8GB', 'N/A', 'Base:2310Mhz; Boost:2535Mhz', 'N/A', '18Gbps', '128bit', 'N/A', '4352', '3x DP', '1x HDMI', '8pin', '500W', 'N/A', 'N/A', 'DirectX 12 Ultimate', '255x136x45.5mm', 'N/A', '3 Years Warranty', '61,630', '57,000', '', 'The Colorful iGame GeForce RTX 4060 Ti Ultra W DUO OC 8GB-V GDDR6 Graphics Card, is capable of producing amazing gaming performance and ray tracing. The GeForce RTX 4060 Ti chip series, a next-generation GPU that enables real-time ray tracing, serves as its foundation. With a base speed of 2310MHz and a boost of 2535MHz, this card\'s core clock allows for incredibly quick and seamless operation. This card has 8GB of memory, which is plenty for the majority of games and apps. Compared to regular GDDR6 memory, this iGame GeForce RTX 4060 Ti Ultra W DUO OC 8GB-V graphics card memory clock, which is 17Gbps, is substantially quicker. This Graphics Card has a 128-bit memory interface which is sufficient for the majority of games and apps. The output of this card includes three DP ports and one HDMI port, which can connect to multiple monitors and devices. The Colorful iGame GeForce RTX 4060 Ti Ultra W DUO OC 8GB-V GDDR6 Graphics Card also features a dual-fan cooling system that can keep the card cool and quiet under heavy load.');

