INSERT INTO `pc_information` (`pc_information_No`, `brand`, `Hide`, `model`, `category`, `processor`, `processor_warranty`, `motherboard`, `motherboard_warranty`, `ram`, `ram_warranty`, `storage`, `storage_warranty`, `casing`, `casing_warranty`, `price`, `cut_price`, `description`, `product_image_path`) VALUES
(1, 'INTEL', 0, 'Pentium Gold G7400', 'special', 'Intel Pentium Gold G7400 Alder Lake Processor', '03 Years Warranty (No Warranty for Fan or Cooler)', 'BIOSTAR H610MHP Micro ATX Motherboard ', '03 Years Warranty', 'PNY XLR8 8GB DDR4 3200MHz Desktop Gaming RAM', 'Life time warranty', 'Team MP33 256GB M.2 PCIe SSD', '05 years warranty', 'Value-Top VT-V100 Mid Tower Micro-ATX Casing', 'No warranty', '22999', '23700', 'The Intel Pentium Gold G7400 Desktop PC is equipped with the latest Alder Lake Processor for optimal performance. Paired with the BIOSTAR H610MHP Micro ATX Motherboard, this PC is designed for efficiency and speed. The PNY XLR8 8GB DDR4 3200MHz Desktop Gaming RAM ensures smooth multitasking, while the Team MP33 256GB M.2 PCIe SSD provides ample storage space. The Value-Top VT-V100 Mid Tower Micro-ATX Casing completes the package with a sleek and modern design. Upgrade your computing experience with the Intel Pentium Gold G7400 Desktop PC.\r\n\r\n', ''),
(2, 'AMD Ryzen', 1, 'Athlon 3000G Budget Desktop PC', 'special', 'AMD Athlon 3000G Processor with Radeon Graphics', '3 Years Warranty (No Warranty for Fan or Cooler)', 'GIGABYTE B450M K AMD AM4 Micro ATX Motherboard', '3 Years Warranty', 'Corsair Vengeance LPX 8GB 3200MHz DDR4 Desktop RAM', 'Lifetime Warranty', 'HP EX900 PLUS 256GB M.2 PCIe NVMe Internal SSD', '3 Years Warranty', 'Revenger BULLET Mini Tower Micro ATX RGB Gaming Case with Power Supply', 'No Warranty', '25640', '28204', 'The AMD Athlon 3000G Budget Desktop PC is a powerful device that may provide outstanding performance without going over budget. This PC, designed for cost-conscious consumers who value dependability and efficiency, combines AMD\'s state-of-the-art processing capability with high-quality components in a well-balanced combination to meet a wide range of computing requirements. The AMD Athlon 3000G Processor with Radeon Graphics is the brains behind the machine, providing powerful processing power and integrated graphics performance for daily use and light gaming. This configuration, when combined with the GIGABYTE B450M K AMD AM4 Micro ATX Motherboard, guarantees flawless compatibility and dependable performance. The system has Corsair Vengeance LPX 8GB 3200MHz DDR4 Desktop RAM to match its processor power, which offers enough memory for seamless multitasking and quick data handling. This setup guarantees responsive speed without sacrificing productivity, whether you\'re streaming video, surfing the web, or using productivity apps. The HP EX900 PLUS 256GB M.2 PCIe NVMe Internal SSD manages storage, providing blazing-fast data access rates and enough of room for your important files and apps. With this powerful SSD, bid slow load times by and welcome immediate response. Encased within the Revenger BULLET Mini Tower Micro ATX RGB Gaming Case, this budget desktop PC not only delivers on performance but also stands out with its sleek design and customizable RGB lighting. Equipped with a power supply unit, cable management features, and ample room for expansion, this case offers both style and functionality. Whether you\'re a student, a professional, or an avid gamer on a budget, the AMD Athlon 3000G Budget Desktop PC is your gateway to reliable performance and immersive computing experiences without breaking the bank.\r\n\r\n', ''),
(3, 'INTEL', 1, 'Intel Core i3-12100 12th Gen Budget Desktop PC', 'special', 'Intel Core i3-12100 12th Gen Alder Lake Processor (Tray)', '03 Years Warranty', 'MSI PRO H610M-E DDR4 mATX Motherboard', '03 Years Warranty', 'Team Elite Plus Red 8GB 3200MHz DDR4 U-DIMM Desktop RAM', 'Life time Warranty', 'Western Digital Green SN350 240GB M.2 NVMe Gen3 SSD', '03 years Warranty', 'Golden Field Q25B Mid Tower ATX Case with PSU', 'No Warranty', '25000', '30000', 'The Intel Core i3-12100 12th Gen Budget Desktop PC is a well-built device that appeals to customers looking for a system that strikes a compromise between price and functionality. The Intel Core i3-12100, a 12th-generation Alder Lake CPU that highlights Intel\'s cutting-edge hybrid architecture, is the central component of this configuration. With a base clock of 3.3 GHz and a maximum turbo boost capability of 4.3 GHz, this quad-core, 8-thread CPU is a good performer for productivity work, light gaming, and general computing. The MSI PRO H610M-E DDR4 mATX Motherboard, which supports the newest 12th Gen CPUs on an LGA 1700 socket and offers necessary capabilities in a small microATX form size, offers a dependable basis for the construction. A red heat spreader adds style to the construction and helps with heat dissipation. An 8GB stick of Team Elite Plus Red 3200MHz DDR4 RAM guarantees seamless multitasking and effective access to commonly used data. A Western Digital Green SN350 240GB M.2 NVMe Gen3 SSD may meet storage demands. With read speeds of up to 2400 MB/s, it keeps the system efficient and delivers quick load times for the operating system and apps. The Golden Field Q25B Mid Tower ATX Case, which houses these parts, not only accommodates a range of motherboard sizes but also includes a pre-installed power supply, saving you money and trouble. The case\'s elegant design contains many fan mounts to keep the system cool even under load and a side panel glass that displays the interior parts. This desktop PC is a great option for various customers, from professionals to students, who want a powerful computer without going over budget. It is proof that affordable builds can still provide a satisfactory user experience.\r\n\r\n', ''),
(4, 'AMD Ryzen', 0, 'Ryzen 5 2400G Desktop PC', 'special', 'AMD Ryzen 5 2400G Desktop Processor with Radeon RX Vega 11 Graphics', '3 Years Warranty (No Warranty for Fan or Cooler)', 'MSI B450M-A PRO MAX AMD AM4 Motherboard', '3 Years Warranty', 'Team Elite Plus Red 8GB 3200MHz DDR4 U-DIMM Desktop RAM', 'Lifetime Warranty', 'Kimtigo TP3000 256GB M.2 NVMe PCIe Gen3x4 SSD', '3 Years Warranty', 'Value-Top VT-M200 Mid Tower Micro ATX Casing', 'No Warranty', '26100', '27890', 'The AMD Ryzen 5 2400G Desktop PC is a powerful and efficient system designed for seamless performance. Equipped with the AMD Ryzen 5 2400G Desktop Processor with Radeon RX Vega 11 Graphics, this PC delivers stunning visuals and smooth multitasking capabilities. The MSI B450M-A PRO MAX AMD AM4 Motherboard ensures reliable connectivity and enhanced durability. With the Team Elite Plus Red 8GB 3200MHz DDR4 U-DIMM Desktop RAM, you can expect fast and efficient data processing. The Value-Top VT-M200 Mid Tower Micro ATX Casing provides ample space for expansion and optimal cooling. Store and access your files effortlessly with the Kimtigo TP3000 256GB M.2 NVMe PCIe Gen3x4 SSD. Upgrade your computing experience with the AMD Ryzen 5 2400G Desktop PC.\r\n\r\n', ''),
(6, 'INTEL', 0, '12th Gen Core i7-12700K Custom Gaming Desktop PC', 'INTEL', 'Intel 12th Gen Core i7-12700K Alder Lake Processor', '03 Years Warranty', 'GIGABYTE Z790 UD AX ATX Motherboard', '03 Years Warranty', 'Corsair VENGEANCE RGB 16GB DDR5 6000MHz RAM', 'Life time Warranty', 'Samsung 980 Pro 1TB PCIe 4.0 M.2 NVMe SSD', '03 years Warranty', 'Gamdias ATHENA P1 Mid Tower PC Gaming Case', 'Gamdias ATHENA P1 Mid Tower PC Gaming Case No Warranty', '170,600', '187,660', 'The Intel 12th Gen Core i7-12700K Custom Gaming Desktop PC is a powerhouse of a machine designed for the ultimate gaming experience. Featuring the latest Intel 12th Gen Core i7-12700K Alder Lake Processor and GIGABYTE Z790 UD AX ATX Motherboard, this desktop PC delivers lightning-fast performance and seamless multitasking capabilities. The Corsair VENGEANCE RGB 16GB DDR5 6000MHz RAM ensures smooth and efficient operation, while the Samsung 980 Pro 1TB PCIe 4.0 M.2 NVMe SSD provides ample storage space for all your games and files. The GIGABYTE GeForce RTX 3060 Ti EAGLE OC D6X 8G 8GB GDDR6X Graphics Card delivers stunning visuals and smooth gameplay, while the Thermalright Frozen Notte 240 BLACK ARGB CPU Cooler keeps your system cool and quiet. The Corsair HX Series HX750 750W 80+ PLATINUM Full Modular ATX Power Supply ensures reliable and efficient power delivery, while the Gamdias ATHENA P1 Mid Tower PC Gaming Case provides stylish and functional housing for your system. Get ready to take your gaming to the next level with the Intel 12th Gen Core i7-12700K Custom Gaming Desktop PC.\r\n\r\n', '');
INSERT INTO `pc_information` (`pc_information_No`, `brand`, `Hide`, `model`, `category`, `processor`, `processor_warranty`, `motherboard`, `motherboard_warranty`, `ram`, `ram_warranty`, `storage`, `storage_warranty`, `casing`, `casing_warranty`, `price`, `cut_price`, `description`, `product_image_path`) VALUES
(7, 'INTEL', 0, '12th Gen Gaming Desktop PC', 'INTEL', 'Intel 12th Gen Core i7-12700K Alder Lake Processor', '03 Years Warranty (No Warranty for Fan or Cooler)', 'GIGABYTE Z790 UD AX ATX Motherboard', '03 Years Warranty', 'Kingston FURY Beast 16GB 6000MHz DDR5 RGB Desktop RAM', 'Life time warranty', 'Samsung 980 Pro 500GB PCIe 4.0 M.2 NVMe SSD', '03 years warranty', 'Lian Li LANCOOL 215 ARGB ATX Gaming Case (Black)', 'No warranty', '147,999', '164,548', 'The Intel 12th Gen Core i7-12700K Gaming Desktop PC is a powerful gaming setup. It features the Intel 12th Gen Core i7-12700K Alder Lake Processor with the GIGABYTE Z790 UD AX ATX Motherboard. The Desktop PC has 16GB of Kingston FURY Beast 6000MHz DDR5 RGB Desktop RAM and a Colorful GeForce RTX 3060 NB DUO 8GB-V DDR6 Graphic Card for stunning visuals in games. It comes with a Samsung 980 Pro 500GB PCIe 4.0 M.2 NVMe SSD for fast storage access. To keep things cool, it uses the Lian Li Galahad 240mm Closed-Loop AIO Liquid CPU Cooler and is powered by a Corsair CV650 650Watt 80 Plus Bronze Certified Power Supply. The PC looks stylish in the Lian Li LANCOOL 215 ARGB ATX Gaming Case (Black).\r\n\r\n', ''),
(8, 'INTEL', 0, '13th Gen Gaming Desktop PC', 'INTEL', 'Intel 13th Gen Core i5 13600K Raptor Lake Processor', '03 Years Warranty (No Warranty for Fan or Cooler)', 'GIGABYTE B760M DS3H mATX Motherboard', '03 Years Warranty', 'Corsair VENGEANCE RGB 16GB DDR5 6000MHz RAM', 'Life time Warranty', 'Samsung 980 Pro 500GB PCIe 4.0 M.2 NVMe SSD', '03 years Warranty', 'Corsair 4000D AirFlow Mid Tower ATX Casing', 'No Warranty', '143,800', '158,180', 'The Intel 13th Gen Core i5-13600K Custom Gaming Desktop PC is a powerhouse designed for gamers seeking top-notch performance. Equipped with the Intel 13th Gen Core i5 13600K Raptor Lake Processor and the GIGABYTE B760M DS3H mATX Motherboard, this PC delivers exceptional speed and efficiency. The Corsair VENGEANCE RGB 16GB DDR5 6000MHz RAM ensures smooth multitasking and seamless gameplay. Store your games and files with ease on the Samsung 980 Pro 500GB PCIe 4.0 M.2 NVMe SSD. The GIGABYTE GeForce RTX 3060 WINDFORCE OC 12GB GDDR6 Graphics Card provides stunning visuals and immersive gaming experiences. Keep your system cool with the Thermalright Frozen Notte 240 BLACK ARGB CPU Cooler. The Corsair 4000D AirFlow Mid Tower ATX Casing offers ample space for future upgrades. Powering it all is the reliable Corsair CV650 650Watt 80 Plus Bronze Certified Power Supply. Elevate your gaming experience with the Intel 13th Gen Core i5-13600K Custom Gaming Desktop PC.\r\n\r\n', ''),
(9, 'Rayzen', 0, 'Ryzen 9 7950X Gaming Desktop PC', 'Ryzen', 'AMD Ryzen 9 7950X Processor', '3 Years Warranty (No Warranty for Fan or Cooler)', 'GIGABYTE B650M AORUS ELITE AX DDR5 AMD AM5 Micro-ATX Motherboard', '3 Years Warranty', 'Kingston FURY Beast 16GB 6000MHz DDR5 RGB Desktop RAM', 'Lifetime Warranty', 'Samsung PM9A1 2TB M.2 PCIe Gen 4.0 NVMe SSD', '3 Years Warranty', 'Lian Li LANCOOL III RGB Mid-Tower E-ATX Gaming Case', 'No Warranty', '374,898', '412,388', 'The AMD Ryzen 9 7950X Gaming Desktop PC is powered by the mighty AMD Ryzen 9 7950X processor and backed by the GIGABYTE B650M AORUS ELITE AX DDR5 AMD AM5 Micro-ATX Motherboard. Experience seamless multitasking and smooth gaming with Kingston FURY Beast 16GB 6000MHz DDR5 RGB Desktop RAM. Store all your favorite games and media on the lightning-fast Samsung PM9A1 2TB M.2 PCIe Gen 4.0 NVMe SSD. Prepare for jaw-dropping visuals and mind-blowing frame rates with the Colorful iGame GeForce RTX 4080 16GB Vulcan OC-V GDDR6X Graphics Card. The Antec HCG 1000 Gold Fully Modular Power Supply ensures stable and reliable power delivery for the most demanding gaming sessions. Keep your CPU running cool with the Corsair iCUE H150i ELITE CAPELLIX XT RGB Liquid CPU Cooler. All these top-notch components are housed in the sleek and stylish Lian Li LANCOOL III RGB Mid-Tower E-ATX Gaming Case.\r\n\r\n', ''),
(10, 'Rayzen', 0, 'Ryzen 7 7800X3D Gaming Desktop PC', 'Ryzen', 'AMD Ryzen 7 7800X3D Processor', '3 Years Warranty (No Warranty for Fan or Cooler)', 'MSI MAG B650M MORTAR WIFI DDR5 AMD AM5 mATX Motherboard', '3 Years Warranty', '2x TEAM T-FORCE DELTA RGB 16GB 6000MHz DDR5 Gaming RAM', 'Lifetime Warranty', 'Team MP44L 500GB M.2 PCIe Gen4 NVMe SSD', '5 Years Warranty', 'Lian Li LANCOOL 205M MESH Micro-ATX Gaming Case', 'No Warranty', '199,999', '219,999', 'The AMD Ryzen 7 7800X3D Desktop PC, is a powerful and efficient system designed for high-performance computing. Equipped with the AMD Ryzen 7 7800X3D Processor, this PC delivers exceptional processing power and speed for seamless multitasking and smooth gaming experiences. The MSI MAG B650M MORTAR WIFI DDR5 AMD AM5 mATX Motherboard ensures reliable connectivity and supports the latest DDR5 RAM technology. The TEAM T-FORCE DELTA RGB 16GB 6000MHz DDR5 Gaming RAM provides lightning-fast memory performance, while the Team MP44L 500GB M.2 PCIe Gen4 NVMe SSD offers ample storage space and rapid data transfer speeds. The Sapphire PULSE AMD Radeon RX 7800 XT 16GB GDDR6 Gaming Graphics Card delivers stunning visuals and immersive gaming experiences. The DeepCool AK620 ZERO DARK High-Performance Dual Tower CPU Cooler ensures efficient cooling for optimal performance. With the MSI MPG A750GF 750W 80 Plus Gold Full Modular Power Supply, you can expect reliable and stable power delivery. All of these components are housed in the sleek and stylish Lian Li LANCOOL 205M MESH Micro-ATX Gaming Case, making the AMD Ryzen 7 7800X3D Desktop PC a perfect choice for gamers and professionals alike.\r\n\r\n', ''),
(11, 'Rayzen', 0, 'Model: Ryzen 5 8500G Desktop PC', 'gaming', 'AMD Ryzen 5 8500G Processor with Radeon Graphics', '3 Years Warranty (No Warranty for Fan or Cooler)', 'MSI PRO A620M-E DDR5 AMD mATX Motherboard', '3 Years Warranty', 'TEAM VULCAN Black 8GB DDR5 5200MHz Gaming Desktop RAM', 'Lifetime Warranty', 'HP EX900 PLUS 256GB M.2 PCIe NVMe Internal SSD', '3 Years Warranty', 'Gamdias AURA GC1 Mesh ARGB Mid-tower ATX Gaming Casing', 'No Warranty', '45,999', '54,099', 'The AMD Ryzen 5 8500G Budget Desktop PC is a powerful and affordable option for gamers and professionals alike. Equipped with the AMD Ryzen 5 8500G Processor with Radeon Graphics, this PC delivers impressive performance and stunning visuals. The MSI PRO A620M-E DDR5 AMD mATX Motherboard ensures reliable connectivity and expandability, while the TEAM VULCAN Black 8GB DDR5 5200MHz Gaming Desktop RAM provides smooth multitasking and seamless gaming experience. With the HP EX900 PLUS 256GB M.2 PCIe NVMe Internal SSD, you\'ll enjoy lightning-fast storage and quick boot times. The Gamdias AURA GC1 Mesh ARGB Mid-tower ATX Gaming Casing offers a sleek and stylish design with customizable RGB lighting. To power it all, the Antec META V350 350W Power Supply ensures stable and efficient performance. Upgrade your desktop experience with the AMD Ryzen 5 8500G Budget Desktop PC.\r\n\r\n', '');
INSERT INTO `pc_information` (`pc_information_No`, `brand`, `Hide`, `model`, `category`, `processor`, `processor_warranty`, `motherboard`, `motherboard_warranty`, `ram`, `ram_warranty`, `storage`, `storage_warranty`, `casing`, `casing_warranty`, `price`, `cut_price`, `description`, `product_image_path`) VALUES
(12, 'INTEL', 0, 'Core i5-10400f 10th Gen Gaming PC', 'gaming', 'Intel 10th Gen Core i5-10400F Processor', '03 Years Limited Warranty', 'ASRock B560M-HDV 10th and 11th Gen Micro ATX Motherboard', '03 Years Limited Warranty', 'Team Elite Plus Red 8GB 3200MHz DDR4 U-DIMM Desktop RAM', '03 Years Limited Warranty', 'Toshiba P300 1TB Desktop PC Internal Hard Drive', '03 Years Limited Warranty', 'Antec NX260 Mid Tower ARGB Gaming Case', '03 Years Limited Warranty', '52,100', '53,705', 'Description:\r\n\r\nExperience powerful computing performance with the Intel 10th Gen Core i5-10400F Processor, designed to handle demanding tasks with ease. Paired with the ASRock B560M-HDV 10th and 11th Gen Micro ATX Motherboard, enjoy seamless connectivity and stability for your system.\r\n\r\nEnhance your system\'s multitasking capabilities with the Team Elite Plus Red 8GB 3200MHz DDR4 U-DIMM Desktop RAM, ensuring smooth operation even during intensive workloads. Store all your important files and multimedia content effortlessly with the Toshiba P300 1TB Desktop PC Internal Hard Drive.\r\n\r\nBoost your system\'s responsiveness with the HP EX900 M.2 120GB PCIe NVMe Internal SSD, providing lightning-fast boot times and application loading. Enjoy crisp visuals and smooth gaming performance with the ASUS GeForce GT 1030 2GB GDDR5 Low Profile Graphics Card.\r\n\r\nEnsure reliable and efficient power delivery with the Antec CUPRUM STRIKE CSK 450W 80 Plus Bronze Power Supply, keeping your system running smoothly even under heavy load. Complete your setup with the stylish and functional Antec NX260 Mid Tower ARGB Gaming Case, offering ample space for your components while adding a touch of aesthetic flair with its RGB lighting.', ''),
(13, 'Rayzen', 0, 'Ryzen 7 5700X Gaming Desktop PC', 'gaming', 'AMD Ryzen 7 5700X Processor', '3 Years Warranty (No Warranty for Fan or Cooler)', 'MSI B450M-A PRO MAX AMD AM4 Motherboard', '3 Years Warranty', 'Corsair Vengeance LPX 8GB 3200MHz DDR4 Desktop RAM', 'Lifetime Warranty', 'Team MP33 PRO 512GB M.2 PCIe Gen3 NVMe SSD', '3 Years Warranty', 'Gamdias AURA GC1 Mesh ARGB Mid-tower ATX Gaming Casing', 'No Warranty', '59,800', '64,350', 'The AMD Ryzen 7 5700X Custom Gaming Desktop PC is a beast of a machine that can handle any game or task with ease. It features the AMD Ryzen 7 5700X Processor, an 8-core, 16-thread CPU that delivers incredible performance and efficiency. The MSI B450M-A PRO MAX motherboard supports the latest AMD AM4 processors and has a simple and elegant design. The 8GB of Corsair Vengeance LPX DDR4 RAM and the 512GB of Team MP33 PRO NVMe SSD provide fast and smooth performance for your system. The PELADN RX 580 8GB graphics card delivers stunning visuals and high frame rates for your favorite games. The Gamdias AURA GP450 power supply ensures stable and reliable power delivery for your components. The Gamdias AURA GC1 Mesh ARGB gaming case has a stunning RGB lighting effect and a spacious interior for easy installation. The DeepCool AK500 High-Performance Single Tower CPU Cooler keeps your CPU cool and quiet under heavy load.\r\n\r\n', ''),
(14, 'INTEL', 0, '13th Gen Core i5 13400', 'gaming', 'Intel 13th Gen Core i5 13400 Raptor Lake Processor', '03 Years Warranty', 'GIGABYTE B760M H DDR4 mATX Motherboard', '03 Years Warranty', 'Corsair Vengeance LPX 16GB DDR4 DRAM 3200MHz RAM', 'Life time Warranty', 'Samsung 980 500GB PCIe 3.0 M.2 NVMe SSD', '03 years Warranty', 'MaxGreen 825-V2 Mid-Tower ARGB ATX Gaming Case', 'No Warranty', '69,400', '76,834', 'This Custom Gaming Desktop PC featuring the Intel 13th Gen Core i5 13400 Raptor Lake Processor for lightning-fast performance. Paired with the GIGABYTE B760M H DDR4 mATX Motherboard, this combination ensures seamless multitasking and smooth gameplay. The Corsair Vengeance LPX 16GB DDR4 DRAM 3200MHz RAM provides ample memory for intense gaming sessions. Store all your games and files on the Samsung 980 500GB PCIe 3.0 M.2 NVMe SSD for lightning-fast load times. The PELADN RX 580 8G 256Bit Dual Fans Gaming Graphics Card delivers stunning visuals and immersive gameplay. Power it all with the Gamdias AURA GP550 550W Power Supply, and house your components in the sleek and stylish MaxGreen 825-V2 Mid-Tower ARGB ATX Gaming Case. Elevate your gaming experience with this powerful and reliable gaming setup.\r\n\r\n', '');

