(3, 0, 'Twinmos', '3200MHz DDR4', 'DDR4', '4GB', '3200HMz', '1.2V', 'CL 15', 'N/A', 'N/A', 'Lifetime Warranty', '2,200', '2,000', '', 'The TwinMOS 4GB 3200MHz DDR4 U-DIMM RAM has a 4GB of DDR4 memory capacity. This RAM is a single-channel RAM with a CAS Latency of CL22. It has XMP support and the required voltage for the RAM is 1.2V. The TwinMOS 4GB 3200MHz DDR4 U-DIMM RAM has a frequency speed of 3200MHz.\r\n\r\n'),
(4, 0, 'Colorful', 'Colorful DDR4 8G 2666', 'DDR4', '8GB', '2666 MHz', '1.2V', 'CL19-19-19-43', 'N/A', 'N/A', 'Lifetime', '2,310', '2,100', '', 'Colorful 8GB DDR4 2666MHz U-DIMM Desktop RAM provides a reliable and effective memory solution for desktop computers. It has an 8GB capacity and a DDR4 type that operates at a frequency of 2666 MHz, providing faster data transfer speeds. It saves energy by operating at a low voltage of 1.2V. The Colorful 8GB DDR4 2666MHz RAM has a latency of CL19-19-19-43, which contributes to the system\'s smooth and responsive performance.\r\n\r\n');
INSERT INTO `ram_informations` (`ram_id`, `Hide`, `brand`, `model`, `type`, `capacity`, `frequency`, `operatingVoltage`, `latency`, `dimension`, `pin`, `warranty`, `cut_price`, `price`, `product_image_path`, `description`) VALUES
(5, 0, 'Kimtigo', 'WOLFRINE 8GB High-speed performance', 'DDR4', '8GB', 'N/A', '1.2V', 'CL22', '133mm x 31mm', '260 Pin', 'Lifetime Warranty', '2,490', '2,100', '', 'The Kimtigo WOLFRINE 8GB 3200MHz DDR4 UDIMM Desktop RAM is a high-performance memory module aimed for gamers and enthusiasts alike. Its UDIMM form type provides compatibility with a variety of desktop systems, and its CAS Latencies of 22 and operating voltage of 1.2V contribute to efficient and dependable performance. This RAM module, designed for compatibility with the most recent AMD and Intel platforms, goes beyond normal binning methods; the manufacturer improves performance at the die level, assuring a degree of accuracy that meets the demands of modern computing. The contemporary metal heat spreader is a noteworthy feature that comes in a variety of colors to let customers customize their system configuration or fit their desired aesthetic. In addition to giving the RAM module a sleek appearance, the heat spreader is essential for preserving ideal temperatures throughout prolonged gaming sessions or resource-intensive jobs. High-quality Micron die and dynamic heat spreaders are used in the Kimtigo WOLFRINE series to provide optimal performance and dependability. This DDR4 UDIMM RAM is a tempting option for individuals who want both style and substance in their computing experience, whether you\'re a gamer looking for fluid gaming or a performance fanatic pushing the limits of your system.'),
(6, 0, 'G.SKILL', '2,200', 'DDR4', '8GB (8GBx1)', '2400Mhz', '1.20V', '17-17-17-39', 'N/A', '288-Pin', 'Limited Lifetime', '2,440', '2,200', '', 'The G.SKILL Value 8GB DDR4 2400Mhz RAM is made to provide the best performance on the most recent DDR4 platform. With the newest next-generation PC memory technology, your system will run smoothly whether you are processing a lot of data or playing a lot of games. To guarantee the highest level of performance and stability, all G.SKILL DDR4 memory kits are put through a thorough round of testing. G.SKILL DDR4 memory kits are put through a number of demanding testing in quad-channel memory operations to ensure that they are compatible with the majority of DDR4 platforms. It will work with the broadest range of motherboards and will deliver the best-in-class performance, compatibility, and stability. G.SKILL Value 8GB DDR4 2400Mhz RAM operates at a standard frequency of 2133MHz and offers a substantially larger bandwidth than older DDR memory. For gaming, video and picture editing, rendering, and other business-related apps, you can benefit from a speedier computing experience.');
INSERT INTO `ram_informations` (`ram_id`, `Hide`, `brand`, `model`, `type`, `capacity`, `frequency`, `operatingVoltage`, `latency`, `dimension`, `pin`, `warranty`, `cut_price`, `price`, `product_image_path`, `description`) VALUES
(7, 0, 'ADATA', 'Adata 8 GB DDR4 2666', 'DDR4', '8GB', '2666', 'Power supply VDD and VDDQ = 1.2V0.06V, Operating ', 'N/A', 'N/A', 'N/A', 'Lifetime Warranty', '2,440', '2,250', '', 'ADATA Premier DDR4 2666 unbuffered-DIMM memory is the latest upgrade solution that supports Intel\'s newest platforms for faster data transfer and enhanced power efficiency. Utilizing a 288-pin design, operating voltage has been reduced from 1.5V on DDR3 to 1.2V, which not only helps save power by 20%, but also boosts transfer bandwidth speed to 21.3GB/s. Every chip in ADATA memory modules meets strict JEDEC and RoHS standards, ensuring compatibility, stability, and environmentally friendly products.\r\nInterface 288-pin\r\nDensity 8GB\r\nSpeed 2666MHz\r\nCAS Latency CL 19-19-19\r\nPower supply VDD and VDDQ = 1.2V0.06V\r\nDRAM activation power supply VPP= 2.5V (+0.25V / -0.125V)\r\nDRAM spec/VCC DDR4 STD 1.2V\r\nOperating temperature 0C to 85C \r\nWarranty Lifetime');
INSERT INTO `ram_informations` (`ram_id`, `Hide`, `brand`, `model`, `type`, `capacity`, `frequency`, `operatingVoltage`, `latency`, `dimension`, `pin`, `warranty`, `cut_price`, `price`, `product_image_path`, `description`) VALUES
(8, 0, 'PNY', 'XLR8', 'Desktop DDR4 Gaming RAM', '8GB', '3200MHz (PC4-25600)', '1.35V', 'CL16', 'N/A', 'N/A', 'Life time warranty', '2,890', '2,400', '', 'PNY XLR8 Desktop Gaming RAM comes with 6GB DDR4 3200MHz CL16 (PC4-25600) Frequency Speed. It\'s extreme performance pushes the limit with aggressive speed, low latency, and extreme overclocking capabilities. This New Gaming RAM is also support XMP 2.0 which is Super easy for overlocking and runs at top speed. In this RAM, It is engineered with heat spreaders to keep your device running cool for an ultra-real gaming experience. The PNY\'s premium XLR8 modules combine top-tier components and select ICs for aggressive speed, low latency, bullet-proof reliability, and the extreme overclocking capabilities that serious gamers demand. Overclocking is made easier with Intel XMP compatibility. And PNY\'s radically stylish XLR8 heat spreaders dispense with the heat of battle and look fierce doing it. This exclusive new PNY\'s premium XLR8 memory features our most aggressive speeds, highest bandwidth, lowest latency and power consumption, and most advanced thermal performance for maximum PC stability and responsiveness during memory-intensive gaming and application use and also It\'s modules are rigorously engineered and tested to ensure peak performance in even the most challenging gaming environments. This new PNY XLR8 Desktop Gaming RAM has Lifetime warranty.');
